import React from "react";
import Tariff from "./Tariff";

const App = (props) => {
    const {tariff, tariffName, price, speed, profit} = props;

    return (
      <React.Fragment>
          { profit
                ?<Tariff id={profit} tariff={tariff} tariffName={tariffName} price={price} speed={speed} />
                :<Tariff tariff={tariff} tariffName={tariffName} price={price} speed={speed} />
          } 
      </React.Fragment>
    );
  }

  export default App;
